function loadSpecificFilter(element, extraFilterId, element2, regularFilterId, parameter){
	//preselecting regular filter
	if(parameter!=""){
		if(element2){
			element2.value = parameter;
			element2.onchange();
		}
	}

	//creating and selecting extra filters
	if (element){
		value=element.value;
