function showTooltip(event, message){
	document.getElementById("infoBoxDiv").innerHTML = "<html>"+message+"</html>";
	if (event.x){
		//_x = _ev.x + document.body.scrollLeft;
		//_y = _ev.y + document.body.scrollTop;
		_x = event.clientX + document.body.scrollLeft;
		_y = event.clientY + document.body.scrollTop;;
	}
	if (event.pageX){
		_x = event.pageX;
		_y = event.pageY;
	}

	document.getElementById("infoBoxDiv").style.display="none";
	document.getElementById("infoBoxDiv").style.top=(_y) + "px";
	document.getElementById("infoBoxDiv").style.left=(_x) + "px";
	/*
	if (timerRunning){
		clearTimeout(_timer);
	}
	_timer = setTimeout('document.getElementById("infoBoxDiv").style.display="block"',400);
	timerRunning=true;
	*/

	document.getElementById("infoBoxDiv").style.display="block";
	var width = document.getElementById("infoBoxDiv").offsetWidth;
	var height = document.getElementById("infoBoxDiv").offsetHeight;
	document.getElementById("infoBoxDiv").style.top=(_y-height-10) + "px";
	document.getElementById("infoBoxDiv").style.left=(_x-(width/2)) + "px";
}

function hideTooltip(){
	if (timerRunning){
		clearTimeout(_timer);
	}
	document.getElementById("infoBoxDiv").style.display="none";
	document.getElementById("infoBoxDiv").style.left = "-1000px";
}

function openLink(url){
	window.open(url, '_blank');
  	window.focus();
}

function hideMenu(element){
	element.style.display="none";
	element.left = "-1000px";
}

function highlight(toOn, element){
	if(toOn){
		element.className += " hover";
	} else{
		element.className = element.className.replace(" hover", "");
	}
}

function showMenu(event, items){
	var element = document.getElementById("popupMenuDiv");
	if(element.attachEvent){
		// IE <9 support
		element.attachEvent("onmouseleave", function () {hideMenu(element)});
	}else{
		element.addEventListener("mouseleave", function () {hideMenu(element)});
	}
	var duration = 0;
	var baseId = 0;
	var baseToId = 0;
	var product = "DEFAULT";
	var yachtId = 0;
	var optionId = "";
	var parameters = items.split(",");
	var parameterObj = {};
	var yachtLink = "";
	for(var i = 0; i < parameters.length; i++){
		pair = parameters[i].split("::");
		parameterObj[pair[0]] = pair[1];
	}

	var inner = "";
		if(parameterObj["reserveId"]!=undefined){
		inner += "<div onMouseEnter=highlight(true,this) onMouseLeave=highlight(false,this) onClick=openLink(&quot;../my_bookings/editor.jsp?id="+parameterObj["reserveId"]+"&quot;);><img style='vertical-align:middle;' src='//portal.booking-manager.com:443/wbm2/include/images/icons/page_edit.png'/>&nbsp;View reservation</div>";
	}
		if(parameterObj["yachtId"]!=undefined){
		yachtId = parameterObj["yachtId"];
	}
	if(parameterObj["baseId"]!=undefined){
		baseId = parameterObj["baseId"];
	}
	if(parameterObj["baseToId"]!=undefined){
		baseToId = parameterObj["baseToId"];
	}
	if(parameterObj["product"]!=undefined){
		product = parameterObj["product"];
	}
	if(parameterObj["optionId"]!=undefined){
		optionId = parameterObj["optionId"];
	}
	if(parameterObj["duration"]!=undefined){
		duration = parameterObj["duration"];
	}
	if(parameterObj["dateFrom"]!=undefined){
		date = parameterObj["dateFrom"].split(".");
		if(yachtId > 0 && duration > 0 && date[0] > 0 && date[1] > -1 && date[2] > 0){
			dateFrom = new Date(date[2], date[1], date[0]);
			dateTo = new Date(dateFrom);
			dateTo.setDate(dateTo.getDate() + parseInt(duration));
			if(baseId > 0){
									inner += "<div onMouseEnter=highlight(true,this) onMouseLeave=highlight(false,this) onClick=openLink(&quot;../yachts/index.jsp?view=Booking&yachtId="+yachtId+"&filter_duration="+duration+"&filter_date="+date[0]+"&filter_month="+date[1]+"&filter_year="+date[2]+"&quot;);><img style='vertical-align:middle;' src='//portal.booking-manager.com:443/wbm2/include/images/icons/page.png'/>&nbsp;New reservation</div>";
							}
							inner += "<div onMouseEnter=highlight(true,this) onMouseLeave=highlight(false,this); onClick=PriceQuote.getQuoteItem('"+yachtId+"','"+dateFrom.getTime()+"','"+dateTo.getTime()+"','"+optionId+"','"+baseId+"','"+baseToId+"','"+product+"');hideMenu(this.parentNode);><img style='vertical-align:middle;' src='//portal.booking-manager.com:443/wbm2/include/images/icons/add.png'/>&nbsp;Add to quote</div>";
					}
	}
	if(parameterObj["duration"]!=undefined){
		duration = parameterObj["duration"];
	}
	if(yachtId>0){
		if(parameterObj["yachtLink"]!=undefined){
			yachtLink = parameterObj["yachtLink"];
			inner += "<div onMouseEnter=highlight(true,this) onMouseLeave=highlight(false,this) onClick=openLink('"+yachtLink+"');><img style='vertical-align:middle;' src='//portal.booking-manager.com:443/wbm2/include/images/icons/yachts_16.png'/>&nbsp;View yacht</div>";
		}
	}

	if (event.pageX){
		_x = event.pageX;
		_y = event.pageY;
	}

	element.innerHTML = inner;
	element.style.display="block";
	element.style.top=(_y - 10) + "px";
	element.style.left=(_x - 10) + "px";
}

</script>


