	var input = document.createElement("input");
	input.setAttribute("type", "hidden");
	input.setAttribute("name", "switchableView");
	input.setAttribute("id","switchableView");
	input.setAttribute("value", newView);
	document.forms["box"].appendChild(input);

	document.forms["box"].submit();

	return false;
}

